import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import './ViewJudgment.css';

function ViewJudgment() {
  const { state } = useParams(); // Access the state parameter
  const [filters, setFilters] = useState({
    neutralCitation: '',
    category: '',
    sittingJudge: '',
    formerJudge: '',
    caseNumber: '',
    judgmentDate: '',
  });

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  const handleSearch = () => {
    console.log('Selected filters:', filters);
    // Add logic to fetch and display data based on selected filters
  };

  return (
    <div className="view-judgment-container">
      <h1>View Judgments for {state}</h1>
      <p>Select criteria to filter judgments from {state}.</p>
      <form className="filter-form">
        {/* Neutral Citation Dropdown */}
        <div className="form-group">
          <label htmlFor="neutralCitation">Neutral Citation</label>
          <select
            name="neutralCitation"
            id="neutralCitation"
            value={filters.neutralCitation}
            onChange={handleFilterChange}
            className="form-select"
          >
            <option value="">Select Citation</option>
            <option value="Citation1">Citation 1</option>
            <option value="Citation2">Citation 2</option>
            <option value="Citation3">Citation 3</option>
          </select>
        </div>

        {/* Category Dropdown */}
        <div className="form-group">
          <label htmlFor="category">Category</label>
          <select
            name="category"
            id="category"
            value={filters.category}
            onChange={handleFilterChange}
            className="form-select"
          >
            <option value="">Select Category</option>
            <option value="Civil">Civil</option>
            <option value="Criminal">Criminal</option>
            <option value="Corporate">Corporate</option>
          </select>
        </div>

        {/* Sitting Judges Dropdown */}
        <div className="form-group">
          <label htmlFor="sittingJudge">Sitting Judges</label>
          <select
            name="sittingJudge"
            id="sittingJudge"
            value={filters.sittingJudge}
            onChange={handleFilterChange}
            className="form-select"
          >
            <option value="">Select Judge</option>
            <option value="JudgeA">Judge A</option>
            <option value="JudgeB">Judge B</option>
            <option value="JudgeC">Judge C</option>
          </select>
        </div>

        {/* Former Judges Dropdown */}
        <div className="form-group">
          <label htmlFor="formerJudge">Former Judges</label>
          <select
            name="formerJudge"
            id="formerJudge"
            value={filters.formerJudge}
            onChange={handleFilterChange}
            className="form-select"
          >
            <option value="">Select Judge</option>
            <option value="FormerJudgeA">Former Judge A</option>
            <option value="FormerJudgeB">Former Judge B</option>
            <option value="FormerJudgeC">Former Judge C</option>
          </select>
        </div>

        {/* Case Number Input */}
        <div className="form-group">
          <label htmlFor="caseNumber">Case Number</label>
          <select
            name="caseNumber"
            id="caseNumber"
            value={filters.caseNumber}
            onChange={handleFilterChange}
            className="form-select"
          >
            <option value="">Select Case Number</option>
            <option value="12345">12345</option>
            <option value="67890">67890</option>
            <option value="11223">11223</option>
          </select>
        </div>

        {/* Judgment Date Picker */}
        <div className="form-group">
          <label htmlFor="judgmentDate">Judgment Date</label>
          <input
            type="date"
            name="judgmentDate"
            id="judgmentDate"
            value={filters.judgmentDate}
            onChange={handleFilterChange}
            className="form-date"
          />
        </div>

        {/* Search Button */}
        <button
          type="button"
          className="cta-button"
          onClick={handleSearch}
        >
          Search
        </button>
      </form>
    </div>
  );
}

export default ViewJudgment;
